INSERT INTO assets_master (ticker, asset_type, name, exchange, sector, industry, business_description, headquarters, employees_count) VALUES ('BPYPO', 'STOCK', 'Brookfield Property Partners L.P.', 'NMS', 'Real Estate', 'Real Estate Services', 'Brookfield Property Partners, through Brookfield Property Partners L.P. and its subsidiary Brookfield Property REIT Inc., is one of the world''s premier real estate companies, with approximately $88 billion in total assets. We own and operate iconic properties in the world''s major markets, and our global portfolio includes office, retail, multifamily, logistics, hospitality, triple net lease, manufactured housing and student housing. Brookfield Property Partners is the flagship listed real estate company of Brookfield Asset Management Inc., a leading global alternative asset manager with over $600 billion in assets under management. More information is available at www.brookfield.com. Brookfield Property Partners L.P. operates as a subsidiary of Brookfield Corporation.', 'Hamilton, , Bermuda', 25700);\nINSERT INTO assets_master (ticker, asset_type, name, exchange, sector, industry, business_description, headquarters, employees_count) VALUES ('BATRA', 'STOCK', 'Atlanta Braves Holdings, Inc.', 'NMS', 'Communication Services', 'Entertainment', 'A Liberty Media Corporation possui participações em subsidiárias e outras empresas envolvidas nos setores de mídia e entretenimento. Os principais negócios e ativos da Companhia incluem suas subsidiárias consolidadas Sirius XM Holdings Inc. (SIRIUS XM) e Braves Holdings, LLC (Braves Holdings) e sua afiliada de capital social Live Nation Entertainment, Inc. (Nação ao Vivo). Os segmentos da Companhia são SIRIUS XM, Corporate e outros. O SIRIUS XM fornece um serviço de rádio por satélite baseado em assinatura. Por meio de suas subsidiárias e afiliadas, a Companhia opera principalmente na América do Norte. A empresa também possui uma carteira de investimentos minoritários em empresas de mídia de capital aberto, como Time Warner, Inc. e Viacom, Inc. SIRIUS XM transmite canais de música, esportes, entretenimento, comédia, notícias, tráfego e meteorologia, bem como serviços de infoentretenimento, nos Estados Unidos, mediante assinatura por meio de dois sistemas de rádio via satélite.', 'Atlanta, GA, United States', 1450);\nINSERT INTO assets_master (ticker, asset_type, name, exchange, sector, industry, business_description, headquarters, employees_count) VALUES ('CWBC', 'STOCK', 'Community West Bancshares', 'NCM', 'Financial Services', 'Banks - Regional', 'Community West Bancshares is a financial services company. The Company is the holding company for Community West Bank (the Bank). The principal business activities of the Company are relationship banking, manufactured housing lending and government-guaranteed lending. Its personal banking services include checking, savings, personal loans, real estate loans, personal credit cards, online banking, mobile banking, bill pay, Zelle, eStatements, Certificates of Deposit (CDs) & money markets, Visa Debit Cards, and IRAs. Its business banking services include business loans, agriculture loans, SBA loans, real estate loans, business credit cards, cash management services, business online banking, merchant card services and others. The Bank operates 26 full-service Banking Centers throughout Central California, from Sacramento in the north, throughout the San Joaquin Valley and west to the Coast.', 'Fresno, CA, United States', 342);\nINSERT INTO assets_master (ticker, asset_type, name, exchange, sector, industry, business_description, headquarters, employees_count) VALUES ('DCBO', 'STOCK', 'Docebo Inc.', 'NMS', 'Technology', 'Software - Application', 'Docebo Inc. is a provider of learning platforms with a foundation in artificial intelligence (AI) and innovation. The Company is redefining the way enterprises leverage technology to create and manage content, deliver training, and measure the business impact of their learning programs. Its learning platform includes capabilities, such as learning management and delivery, content marketplace, insights, learning evaluation, advanced analytics, communities, ecommerce, integrations, headless learning, and AI authoring. Its end-to-end learning platform, organizations worldwide are equipped to deliver scaled, personalized learning across all their audiences and use cases, driving growth and powering their business. Its learning platform leverages artificial intelligence and a high-performance workflow engine to save time, handle repetitive tasks, and automate processes. It serves small and medium-sized businesses to large globally distributed enterprises in a wide variety of industries.', 'Toronto, ON, Canada', 991);\nINSERT INTO assets_master (ticker, asset_type, name, exchange, sector, industry, business_description, headquarters, employees_count) VALUES ('ESGL', 'STOCK', 'ESGL Holdings Limited', 'NCM', 'Industrials', 'Waste Management', 'ESGL Holdings Limited is a Singapore-based holding company. The Company conducts its operations through its subsidiary, Environmental Solutions (Asia) Pte. Ltd. (ESA). ESA is a waste management, treatment and recycling company involved in the collection and recycling of hazardous and non-hazardous industrial waste from customers such as pharmaceutical, semiconductor, petrochemical and electroplating companies. ESAs services include recovering minerals and metals from sludges and solid industrial waste, remanufacturing chemicals from acid and alkali waste, recovering energy from packaging waste and recovering energy from wood waste. ESA harvests heat energy from approximately 500 metric tons (MT) a year of waste wood and electrical energy from the sun from its own 750-kilowatt peak (kWp) solar photovoltaic (PV) roof. ESA operates two facilities in Tuas, Singapore.', 'Singapore, , Singapore', 79);\nINSERT INTO assets_master (ticker, asset_type, name, exchange, sector, industry, business_description, headquarters, employees_count) VALUES ('ATLC', 'STOCK', 'Atlanticus Holdings Corporation', 'NMS', 'Financial Services', 'Credit Services', 'Atlanticus Holdings Corporation is a financial technology company. The Company is focused on facilitating consumer credit through the use of financial technology and related services. The Credit as a Service (CaaS) segment includes its private-label credit and general-purpose credit cards, which, through its bank partners, provide financing solutions to consumers. The Auto Finance segment purchases and/or services loans secured by automobiles and provides other financing options to independent automotive dealers and automotive finance companies. Its private-label and general-purpose card products are originated by The Bank of Missouri and WebBank. Its bank partners originate these accounts through multiple channels, including retail and healthcare point-of-sale locations, direct mail solicitation, digital marketing and partnerships with third parties. The Company uses its technology and proprietary predictive analytics, lenders can make instant credit decisions.', 'Atlanta, GA, United States', 417);\nINSERT INTO assets_master (ticker, asset_type, name, exchange, sector, industry, business_description, headquarters, employees_count) VALUES ('CBNA', 'STOCK', 'Chain Bridge Bancorp, Inc.', 'NYQ', 'Financial Services', 'Banks - Regional', 'Chain Bridge Bancorp, Inc. is a bank holding company and the parent of its wholly owned subsidiary, Chain Bridge Bank, N.A. The Company offers a range of commercial and personal banking services, including deposits, treasury management, payments, loans, commercial lending, residential mortgage financing, consumer loans, trusts and estate administration, wealth management, and asset custody. The Company provides deposit services to a wide range of political organizations, including campaign committees, party committees, PACs, Super PACs, and other tax-exempt over 527 organizations. Its digital platform enables to serve clients nationwide without the need for a local physical presence. The Company has specialized expertise in various industries, such as advocacy and law firms, certified public accountants, corporate PACs, government contractors, nonprofit organizations, political committees, property management firms, think tanks, and trade associations.', 'McLean, VA, United States', 84);\nINSERT INTO assets_master (ticker, asset_type, name, exchange, sector, industry, business_description, headquarters, employees_count) VALUES ('CEV', 'STOCK', 'Eaton Vance California Municipal Income Trust', 'ASE', 'Financial Services', 'Asset Management', 'Eaton Vance California Municipal Income Trust is a close ended fixed income mutual fund launched and managed by Eaton Vance Management. It invests in the fixed income markets. The fund invests primarily in debt securities issued by education, hospital, housing, insured-education, insured-electric utilities, insured-hospital, insured-transportation, insured-water and sewer, transportation, and other sectors. Eaton Vance California Municipal Income Trust was formed in 1999 and is domiciled in United States.', 'Boston, MA, United States', NULL);\nINSERT INTO assets_master (ticker, asset_type, name, exchange, sector, industry, business_description, headquarters, employees_count) VALUES ('FGEN', 'STOCK', 'FibroGen, Inc.', 'NMS', 'Healthcare', 'Biotechnology', 'FibroGen, Inc. is a biopharmaceutical company focused on the development of novel therapies at the frontiers of cancer biology and anemia. It is developing FG-3246, a potential first-in-class antibody-drug conjugate (ADC) targeting CD46, for the treatment of metastatic castration-resistant prostate cancer (mCRPC) and potentially other cancers. This program also includes the development of FG-3180, an associated CD46-targeted positron emission tomography (PET) biomarker and imaging agent. It is also developing Roxadustat, an oral medication, first-in-class, oral small molecule hypoxia-inducible factor prolyl hydroxylase inhibitor (HIF-PHI), which is evaluated for the treatment of anemia in patients with chronic kidney disease (CKD), anemia associated with myelodysplastic syndromes and chemotherapy-induced anemia. Roxadustat is approved in China, Europe, Japan, and numerous other countries for the treatment of anemia of CKD in adult patients on dialysis (DD) and not on dialysis (NDD).', 'San Francisco, CA, United States', 225);\nINSERT INTO assets_master (ticker, asset_type, name, exchange, sector, industry, business_description, headquarters, employees_count) VALUES ('BBCP', 'STOCK', 'Concrete Pumping Holdings, Inc.', 'NCM', 'Industrials', 'Engineering & Construction', 'Concrete Pumping Holdings, Inc. is a provider of concrete pumping services and concrete waste management services. The Companys segments include U.S. Concrete Pumping, U.S. Concrete Waste Management Services and U.K. Operations. The U.S. Concrete Pumping core business is the provision of concrete pumping services to general contractors and concrete finishing companies in the commercial, infrastructure and residential sectors. This segment collectively has approximately 90 branch locations across 22 states. The U.S. Concrete Waste Management Services segment consists of the United States-based Eco-Pan, Inc. (Eco-Pan) business. Eco-Pan provides industrial cleanup and containment services, primarily to customers in the construction industry. Eco-Pan uses containment pans specifically designed to hold waste products from concrete and other industrial cleanup operations. The U.K. Operations segment consists of Camfaud Group Limited, Premier and the United Kingdom-based Eco-Pan businesses.', 'Thornton, CO, United States', 1590);\nINSERT INTO assets_master (ticker, asset_type, name, exchange, sector, industry, business_description, headquarters, employees_count) VALUES ('CHSCP', 'STOCK', 'CHS Inc.', 'NMS', 'Consumer Defensive', 'Farm Products', 'CHS Inc. is an integrated agricultural company, which provides grain, food, agronomy and energy resources to businesses and consumers on a global basis. It provides a variety of products and services, ranging from initial agricultural inputs such as fuels, farm supplies, crop nutrients and crop protection products to agricultural outputs that include grain and oilseed, processed grain and oilseed, renewable fuels and food products. It operates through three segments: Energy, Ag and Nitrogen Production. Its Energy segment produces and sells (primarily wholesale) gasoline, diesel fuel, propane, asphalt, lubricants and other related products, and also provides transportation services. Its Ag segment includes global grain and processing, ag retail and wholesale agronomy businesses. Its Nitrogen Production segment consists of its equity method investment in CF Industries Nitrogen, LLC (CF Nitrogen), which produces nitrogen-based products, including methanol, UAN, urea and related products.', 'Inver Grove Heights, MN, United States', NULL);\nINSERT INTO assets_master (ticker, asset_type, name, exchange, sector, industry, business_description, headquarters, employees_count) VALUES ('AEFC', 'STOCK', 'Aegon Funding Company LLC 5.10%', 'NYQ', NULL, NULL, 'AEGON Funding Company LLC is a United States-based company. The Company operates as a special purpose entity. The Company offers services like issuing debt securities, refinance indebtedness, and for acquisition purposes. The Company is a subsidiary of Aegon NV.', '', NULL);\nINSERT INTO assets_master (ticker, asset_type, name, exchange, sector, industry, business_description, headquarters, employees_count) VALUES ('ELAB', 'STOCK', 'PMGC Holdings Inc.', 'NCM', 'Healthcare', 'Biotechnology', 'PMGC Holdings Inc. is a diversified holding company that manages and grows its portfolio through strategic acquisitions, investments, and development across various industries. The Companys portfolio consists of three wholly owned subsidiaries: Northstrive Biosciences Inc., PMGC Research Inc., and PMGC Capital LLC. Northstrive Biosciences Inc. is a biopharmaceutical company focusing on the development and acquisition of cutting-edge aesthetic medicines. Its lead asset, EL-22, is leveraging a first-in-class engineered probiotic approach to address obesitys pressing issue of preserving muscle while on weight loss treatments, including GLP-1 receptor agonists. PMGC Research Inc. is a research and development subsidiary of the Company, which is focused on advancing the frontiers of scientific discovery. PMGC Capital LLC is a multi-strategy investment vehicle engaging in investing, lending, and seeking diversified investment opportunities across various markets.', 'Newport Beach, CA, United States', 2);\nINSERT INTO assets_master (ticker, asset_type, name, exchange, sector, industry, business_description, headquarters, employees_count) VALUES ('MIO', 'STOCK', 'Pioneer Municipal High Income Opportunities Fund, Inc.', 'NYQ', 'Financial Services', 'Asset Management', 'Pioneer Municipal High Income Opportunities Fund, Inc. (the Fund) is a diversified, closed-end management investment company. The Fund''s primary investment objective is to provide holders of the Fund''s common stock with a high level of current income exempt from regular federal income tax. As a secondary investment objective, the Fund may seek capital appreciation to the extent consistent with its primary investment objective. The Fund invests approximately 80% of its net assets (plus the amount of borrowings, if any, for investment purposes) in securities issued by or on behalf of states, counties, municipalities, territories, and possessions of the United States and the District of Columbia and their authorities, political subdivisions, agencies, and instrumentalities, the interest, on which is exempt from regular federal income tax (municipal securities). It invests without limit in debt securities of any credit quality. Its investment advisor is Amundi Asset Management US, Inc.', 'Boston, MA, United States', NULL);\nINSERT INTO assets_master (ticker, asset_type, name, exchange, sector, industry, business_description, headquarters, employees_count) VALUES ('ACNT', 'STOCK', 'Ascent Industries Co.', 'NGM', 'Basic Materials', 'Steel', 'Ascent Industries Co. is an industrials company focused on the production and distribution of specialty chemicals and industrial tubular products. Its segments include Specialty Chemicals and Tubular Products. The Specialty Chemicals segment produces critical ingredients and process aids for the oil & gas, household, industrial and institutional (HII), personal care, coatings, adhesives, sealants and elastomers (CASE), pulp and paper, textile, automotive, agricultural, water treatment, construction and other industries. The Specialty Chemicals segment includes plants involved in the production of specialty chemicals. The Tubular Products segment includes the operating results of the Companys plants involved in the production of stainless-steel tube. The Tubular Products segment serves markets through tube and customers in the appliance, architectural, automotive and commercial transportation, brewery, furniture, food processing, HVAC, marine, medical, oil and gas and other industries.', 'Schaumburg, IL, United States', 451);\nINSERT INTO assets_master (ticker, asset_type, name, exchange, sector, industry, business_description, headquarters, employees_count) VALUES ('AGIX', 'STOCK', 'KraneShares Artificial Intelligence and Technology ETF', 'NGM', NULL, NULL, 'The underlying index is a modified, free float adjusted market capitalization weighted index designed to measure the equity performance of companies in developed markets with exposure to AI businesses. Under normal circumstances, the fund invests principally in instruments in the underlying index. The fund is non-diversified.', '', NULL);\nINSERT INTO assets_master (ticker, asset_type, name, exchange, sector, industry, business_description, headquarters, employees_count) VALUES ('CENT', 'STOCK', 'Central Garden & Pet Company', 'NMS', 'Consumer Defensive', 'Packaged Foods', 'Central Garden & Pet Company is engaged in the garden and pet industries. The Company offers a diverse portfolio of more than 65 brands, including Amdro, Aqueon, Cadet, C and S, Farnam, Ferry Morse, Four Paws, Kaytee, Nylabone, and Pennington. The Companys segments include Pet and Garden. The Pet segment includes dog and cat supplies such as treats and chews, toys, beds and containment, grooming products, waste management and training pads; supplies for aquatics, small animals, reptiles and pet birds including toys, enclosures and habitats, bedding, food and supplements; products for equine and livestock, animal and household health and insect control products; live fish and small animals as well as outdoor cushions. The Garden segment includes lawn and garden consumables such as grass seed; vegetable, flower and herb packet seed; wild bird feed, bird houses and other birding accessories; weed, grass, and other herbicides, insecticide and pesticide products, and live plants.', 'Walnut Creek, CA, United States', 6000);\nINSERT INTO assets_master (ticker, asset_type, name, exchange, sector, industry, business_description, headquarters, employees_count) VALUES ('COFS', 'STOCK', 'ChoiceOne Financial Services, Inc.', 'NCM', 'Financial Services', 'Banks - Regional', 'ChoiceOne Financial Services, Inc. is a financial holding company headquartered in Sparta, Michigan and the parent corporation of ChoiceOne Bank and The State Bank. It operates 56 offices in parts of Kent, Ottawa, Muskegon, Newaygo, Lapeer, St. Clair, Macomb, Genesee, Jackson, Livingston, Ingham, Saginaw, Shiawassee, and Bay counties. It offers deposit, payment, credit and other financial services to all types of customers. Its services include time, savings, and demand deposits, safe deposit services, and automated transaction machine services. Commercial lending covers such categories as business, industry, agricultural, construction, inventory, and real estate. It provides services to small businesses and consumers in West, Central and Southeast Michigan a line of products and services delivered through a retail network including digital and branch banking. It offers insurance and investment products through ChoiceOne Insurance Agencies, Inc.', 'Sparta, MI, United States', 571);\nINSERT INTO assets_master (ticker, asset_type, name, exchange, sector, industry, business_description, headquarters, employees_count) VALUES ('BLW', 'STOCK', 'BlackRock Limited Duration Income Trust', 'NYQ', 'Financial Services', 'Asset Management', 'BlackRock Limited Duration Income Trust is a close ended fixed income mutual fund launched by BlackRock, Inc. It is managed by BlackRock Advisors, LLC. The fund invests in fixed income securities of the United States. It invests in securities of companies operating across diversified sectors. The fund primarily invests in investment grade corporate bonds, mortgage-related securities, asset-backed securities, US Government and agency securities, and senior, secured floating rate loans. It has an average portfolio duration of less than five years. The fund benchmarks the performance of its portfolio against the Lehman Brothers U.S. Aggregate Index. BlackRock Limited Duration Income Trust was formed on July 31, 2003 and is domiciled in the United States.', 'New York, NY, United States', NULL);\nINSERT INTO assets_master (ticker, asset_type, name, exchange, sector, industry, business_description, headquarters, employees_count) VALUES ('ASR', 'STOCK', 'Grupo Aeroportuario del Sureste, S. A. B. de C. V.', 'NYQ', 'Industrials', 'Airports & Air Services', 'O Grupo Aeroportuario del Sureste SAB de CV (ASUR) é uma holding sediada no México. Ela e suas subsidiárias possuem concessões para operar, manter e desenvolver aproximadamente nove aeroportos na região sudeste do México, bem como em mais de 10 aeroportos na Colômbia. A Companhia opera por meio de segmentos, incluindo o aeroporto de Cancun e subsidiárias (Cancun), o Aeroporto de Villahermosa (Villahermosa), o aeroporto de Mérida (Mérida) e Serviços. Os aeroportos estão localizados em Cancun, Cozumel, Mérida, Huatulco, Oaxaca, Veracruz, Villahermosa, Tapachula e Minatitlan, no México, e em Medellín, na Colômbia, entre outros. Aproximadamente oito companhias aéreas Mexicanas e mais de 80 internacionais, incluindo companhias aéreas sediadas nos Estados Unidos, como as American Airlines e United Air Lines, operam diretamente ou por meio de acordos de compartilhamento de códigos em seus aeroportos. Ela fornece serviços de segurança aeroportuária em seus aeroportos por meio de terceiros. Tam', 'Mexico City, DF, Mexico', 1936);\nINSERT INTO assets_master (ticker, asset_type, name, exchange, sector, industry, business_description, headquarters, employees_count) VALUES ('FATBP', 'STOCK', 'FAT Brands Inc.', 'NCM', 'Consumer Cyclical', 'Restaurants', 'FAT Brands Inc. is a global franchising company, which acquires, markets, and develops fast casual, quick-service, casual dining, and polished casual dining concepts around the world. It owns 18 restaurant brands: Round Table Pizza, Fatburger, Marble Slab Creamery, Johnny Rockets, Fazolis, Twin Peaks, Great American Cookies, Smokey Bones, Hot Dog on a Stick, Buffalos Cafe & Express, Hurricane Grill & Wings, Pretzelmaker, Elevation Burger, Native Grill & Wings, Yalla Mediterranean and Ponderosa and Bonanza Steakhouses, and franchises and owns over 2,300 units worldwide. Round Table Pizza is the franchisor of quick service restaurants located in California and the western United States. Hot Dog on a Stick is the franchisor of quick service restaurants located in regional malls in California and the western United States. Johnny Rockets is an international restaurant franchise and offers menu items including Certified Angus Beef cooked-to-order hamburgers, chicken sandwiches, and malts.', 'Beverly Hills, CA, United States', 2089);\nINSERT INTO assets_master (ticker, asset_type, name, exchange, sector, industry, business_description, headquarters, employees_count) VALUES ('BHRB', 'STOCK', 'Burke & Herbert Financial Services Corp.', 'NCM', 'Financial Services', 'Banks - Regional', 'Burke & Herbert Financial Services Corp. is a financial holding company for Burke & Herbert Bank & Trust Company (the Bank). The Bank offers a full range of business and personal financial solutions designed to meet customers'' banking, borrowing, and investment needs. The Bank has over 77 branches across Delaware, Kentucky, Maryland, Virginia, and West Virginia. The Banks primary source of funding is deposits, both interest-bearing and non-interest-bearing. The Bank provides a range of commercial lending services, including commercial real estate loans, acquisition, construction & development, commercial and industrial loans, and residential real estate loans to customers generally located or conducting business in its market area. It also provides traditional banking and wealth management services. The Bank offers digital banking, mobile banking, and a remote deposit service, which allows customers to facilitate and expedite deposit transactions through the use of electronic devices', 'Alexandria, VA, United States', 819);\nINSERT INTO assets_master (ticker, asset_type, name, exchange, sector, industry, business_description, headquarters, employees_count) VALUES ('ACTU', 'STOCK', 'Actuate Therapeutics, Inc. Common stock', 'NGM', 'Healthcare', 'Biotechnology', 'Actuate Therapeutics, Inc. is a clinical-stage biopharmaceutical company. The Company is focused on developing therapies for the treatment of high impact, difficult to treat cancers through the inhibition of glycogen synthase kinase-3 (GSK-3). The Company is developing elraglusib, a small molecule that is designed to enter cancer cells and block the function of the enzyme GSK-3b, a master regulator of complex biological signaling cascades, including those mediated by oncogenes, which lead to tumor cell survival, growth, migration, and invasion. Its candidate products are Elraglusib Injection and Elraglusib Oral Tablet. Elraglusib is the lead drug in the portfolio and is being evaluated in a randomized Phase II trial in patients with metastatic pancreatic ductal adenocarcinoma (mPDAC). Elraglusib is designed to act as a mediator of antitumor immunity through the inhibition of NF-kB and regulates multiple immune checkpoints and immune cell function.', 'Fort Worth, TX, United States', 10);\nINSERT INTO assets_master (ticker, asset_type, name, exchange, sector, industry, business_description, headquarters, employees_count) VALUES ('BIVI', 'STOCK', 'BioVie Inc.', 'NCM', 'Healthcare', 'Biotechnology', 'BioVie Inc. is a clinical-stage company developing drug therapies to treat chronic debilitating conditions including liver disease and neurological and neuro-degenerative disorders. In neurodegenerative disease, the Companys drug candidate bezisterim (NE3107) inhibits inflammatory activation of extracellular signal-regulated kinase and the transcription factor, Nuclear factor- kB, and the associated neuroinflammation and insulin resistance but not extracellular single-regulated kinase (ERK) and nuclear factor kappa-light-chain-enhancer of activated B cells (NFkB) homeostatic functions (insulin signaling and neuron growth and survival). Both inflammation and insulin resistance are drivers of Alzheimers disease (AD) and Parkinsons disease (PD). In liver disease, its orphan drug candidate BIV201 (continuous infusion terlipressin) is in the phase 3 clinical testing of BIV201 for the reduction of further decompensation in participants with liver cirrhosis and ascites.', 'Carson City, NV, United States', 14);\nINSERT INTO assets_master (ticker, asset_type, name, exchange, sector, industry, business_description, headquarters, employees_count) VALUES ('ACR', 'STOCK', 'ACRES Commercial Realty Corp.', 'NYQ', 'Real Estate', 'REIT - Mortgage', 'ACRES Commercial Realty Corp. is a real estate investment trust. The Company is primarily focused on originating, holding and managing commercial real estate (CRE) mortgage loans and equity investments in commercial real estate property through direct ownership and joint ventures. The Company is externally managed by ACRES Capital, LLC, a subsidiary of ACRES Capital Corp., a private commercial real estate lender dedicated to nationwide middle market CRE lending with a focus on multifamily, student housing, hospitality, industrial and office property in the United States markets. Its objective is to provide its stockholders with total returns over time, including the payment of quarterly distributions when approved by its board of directors and capital appreciation, while seeking to manage the risks associated with its investment strategies. It invests in CRE whole loans, CRE mezzanine loans and CRE equity investments.', 'Uniondale, NY, United States', NULL);\nINSERT INTO assets_master (ticker, asset_type, name, exchange, sector, industry, business_description, headquarters, employees_count) VALUES ('CTRN', 'STOCK', 'Citi Trends, Inc.', 'NMS', 'Consumer Cyclical', 'Apparel Retail', 'Citi Trends, Inc. is a retailer of apparel, accessories and home trends primarily for African American families in the United States. The Company operates 590 stores located in 33 states. It offers a range of merchandise, including a range of apparel for juniors, missy and plus size, including trend right sportswear, outerwear, sleepwear, lingerie and scrubs; a selection of apparel for men and big men, including trend right sportswear and outerwear; an assortment of basics, fashion and trends for boys up to size 20 and girls up to size 16 and also, sizes for newborns, infants and toddlers, and kids uniforms, accessories and sleepwear, and fashionable handbags, luggage, hats, belts, sunglasses, jewelry and watches for men and women, underwear and socks for the entire family, as well as beauty and fragrance offerings for women and men. It also offers home goods for the bedroom, bathroom, kitchen and decorative accessories and casual and dress footwear in sizes for men, women and kids.', 'Savannah, GA, United States', 2600);\nINSERT INTO assets_master (ticker, asset_type, name, exchange, sector, industry, business_description, headquarters, employees_count) VALUES ('ODC', 'STOCK', 'Oil-Dri Corporation of America', 'NYQ', 'Basic Materials', 'Specialty Chemicals', 'Oil-Dri Corporation of America is a manufacturer and supplier of specialty sorbent products for the pet care, animal health and nutrition, fluids purification, agricultural ingredients, sports field, industrial and automotive markets. Its segments include Retail and Wholesale Products Group, and Business to Business Products Group. Retail and Wholesale Products Group segment''s customers include mass merchandisers, the farm and fleet channel, drugstore chains, pet specialty retail outlets, dollar stores, marketers of consumer products, and others. Business to Business Products Group segment''s customers include processors and refiners of edible oils, renewable diesel, petroleum-based oils and biodiesel fuel; manufacturers of animal feed and agricultural chemicals, and distributors of animal health and nutrition products. Its products include Cat''s Pride, Jonny Cat, Ultra Pet, Amlan Products, Pros Choice Products, Select, Pure-Flo, Metal X/Metal Z, Ultra Clear, Agsorb and Verge.', 'Chicago, IL, United States', 949);\nINSERT INTO assets_master (ticker, asset_type, name, exchange, sector, industry, business_description, headquarters, employees_count) VALUES ('ALX', 'STOCK', 'Alexander''s, Inc.', 'NYQ', 'Real Estate', 'REIT - Retail', 'Alexander''s, Inc. is a real estate investment trust (REIT). The Company is engaged in leasing, managing, developing and redeveloping its properties. It is managed by, and its properties are leased and developed by, Vornado Realty Trust (Vornado). It has five properties in New York City consisting of 731 Lexington Avenue, a 1,079,000 square foot multi-use building comprising the entire block bounded by Lexington Avenue, East 59th Street, Third Avenue and East 58th Street in Manhattan; Rego Park I, a 338,000 square foot shopping center, is located on Queens Boulevard and 63rd Road in Queens; Rego Park II, a 616,000 square foot shopping center, is located adjacent to the Rego Park I shopping center in Queens; Flushing, a 167,000 square foot building, located on Roosevelt Avenue and Main Street in Queens, and The Alexander apartment tower, located above its Rego Park II shopping center, contains 312 units aggregating 255,000 square feet.', 'Paramus, NJ, United States', 90);\nINSERT INTO assets_master (ticker, asset_type, name, exchange, sector, industry, business_description, headquarters, employees_count) VALUES ('AGAE', 'STOCK', 'Allied Gaming & Entertainment Inc.', 'NCM', 'Communication Services', 'Entertainment', 'Allied Gaming & Entertainment, Inc. is a global experiential entertainment company. The Company is focused on providing a growing world of gamers and concertgoers with experiences through assets, products and services. The Companys segments include E-sports, Casual mobile gaming, and Concerts. E-sports, provided through Allied Esports, including video game events and tournaments. Casual mobile gaming, provided through Z-Tech. Live concert promotion and event organizing are provided by Skyline. The Company operates through its wholly owned subsidiaries, Allied Esports International, Inc., which operates global competitive e-sports properties designed to connect players and fans via a network of connected arenas; Esports Arena Las Vegas, LLC, which operates a flagship gaming arena located at the Luxor Hotel in Las Vegas, Nevada, and Allied Mobile Entertainment Inc., which is dedicated to exploring opportunities in the massive and growing mobile games markets.', 'New York, NY, United States', NULL);\nINSERT INTO assets_master (ticker, asset_type, name, exchange, sector, industry, business_description, headquarters, employees_count) VALUES ('EEX', 'STOCK', 'Emerald Holding, Inc.', 'NYQ', 'Communication Services', 'Advertising Agencies', 'Emerald Holding, Inc. is a business-to-business (B2B) event organizer principally in the United States. The Company integrates live events, media content, industry insights, digital tools, data-focused solutions, and e-commerce platforms into three complementary business lines: Connections, Content and Commerce. The Connections division consists of a collection of B2B events spanning trade shows, conferences, B2C showcases and a scaled hosted buyer platform. The Content division consists of B2B print publications and digital media products that complement its existing trade show properties. The Commerce division offers B2B e-commerce and digital merchandising solutions, serving the needs of manufacturers and retailers through its Elastic Suite and Bulletin platforms, which create a digital year-round transactional platform for use by its customers, regardless of location. It also operates content and content-marketing websites, related digital products, and produces publications.', 'New York, NY, United States', 697);\nINSERT INTO assets_master (ticker, asset_type, name, exchange, sector, industry, business_description, headquarters, employees_count) VALUES ('TRAK', 'STOCK', 'ReposiTrak, Inc.', 'NYQ', 'Technology', 'Software - Application', 'Repositrak, Inc., provides retailers, suppliers, and wholesalers with a solution suite to help reduce risk and remain in compliance with regulatory requirements. The Company is a software-as-a-service (SaaS) provider, which operates a business-to-business (B2B) e-commerce, compliance and traceability, and supply chain management platform that partners with retailers, wholesalers, distributors and their product suppliers. Its services include three application suites, such as ReposiTrak Compliance Management (compliance), ReposiTrak Traceability Network (traceability), and ReposiTrak Supply Chain Solutions (supply chain). Its compliance helps its customers vet suppliers and reduce a companys potential regulatory, legal, and criminal risk from its supply chain partners. Its traceability helps the Companys customers comply with federal regulatory requirements of traceability. Its supply chain helps its customers to more efficiently manage various interactions with their suppliers.', 'Murray, UT, United States', 73);\nINSERT INTO assets_master (ticker, asset_type, name, exchange, sector, industry, business_description, headquarters, employees_count) VALUES ('CSBR', 'STOCK', 'Champions Oncology, Inc.', 'NCM', 'Healthcare', 'Biotechnology', 'Champions Oncology, Inc. is a preclinical and clinical research services provider. The Company is engaged in the development and sale of advanced technology solutions and products to personalize the development and use of oncology drugs through its translational oncology solutions. This technology ranges from computational-based discovery platforms, oncology software solutions, and proprietary experimental tools such as in vivo, ex vivo and biomarker platforms. Utilizing its TumorGraft Technology Platform (the Platform), it provides select services to pharmaceutical and biotechnology companies seeking personalized approaches to drug development. It also sells Lumin Bioinformatics (Lumin), an oncology data-driven software program which contains comprehensive information derived from its research services and clinical studies. Lumin leverages a large data center coupled with analytics and artificial intelligence to provide a robust tool for computational cancer research.', 'Hackensack, NJ, United States', 213);\nINSERT INTO assets_master (ticker, asset_type, name, exchange, sector, industry, business_description, headquarters, employees_count) VALUES ('AP', 'STOCK', 'Ampco-Pittsburgh Corporation', 'NYQ', 'Industrials', 'Metal Fabrication', 'Ampco-Pittsburgh Corporation manufactures and sells highly engineered, high-performance specialty metal products and customized equipment utilized by industry throughout the world. The Company''s segments include Forged and Cast Engineered Products (FCEP) and Air and Liquid Processing (ALP). The FCEP segment produces forged hardened steel rolls, cast rolls and forged engineered products (FEP). Forged hardened steel rolls are used primarily in hot and cold rolling. Cast rolls, which are produced in a variety of iron and steel qualities. The ALP segment includes Aerofin, Buffalo Air Handling and Buffalo Pumps, all divisions of Air & Liquid Systems Corporation, a subsidiary of the Company. Aerofin produces custom-engineered finned tube heat exchange coils and related heat transfer products for a variety of industries, including original equipment manufacturers and commercial, nuclear power generation and industrial manufacturing.', 'Carnegie, PA, United States', 1634);\nINSERT INTO assets_master (ticker, asset_type, name, exchange, sector, industry, business_description, headquarters, employees_count) VALUES ('BJDX', 'STOCK', 'Bluejay Diagnostics, Inc.', 'NCM', 'Healthcare', 'Medical Devices', 'Bluejay Diagnostics, Inc. is a medical diagnostics company focused on improving patient outcomes in critical care settings. It develops rapid tests using whole blood on its Symphony technology platform (Symphony), which consists of an analyzer and single-use protein detection cartridges that have the function of automatic stepwise feeding of reagent. The Symphony device is designed to produce laboratory-quality results in 20 minutes in critical care settings, including Intensive Care Units (ICUs) and Emergency Rooms (ERs). Its product candidate, the Symphony IL-6 test, is an immunoassay for the measurement of interleukin-6 (IL-6) to be used for the monitoring of disease progression in critical care settings. It is focused on pursuing the Symphony IL-6 test in the context of sepsis. IL-6 is a clinically established inflammatory biomarker, and is considered a ''first-responder'', for the assessment of severity of infection and inflammation across many disease indications, including sepsi', 'Acton, MA, United States', 5);\nINSERT INTO assets_master (ticker, asset_type, name, exchange, sector, industry, business_description, headquarters, employees_count) VALUES ('COHN', 'STOCK', 'Cohen & Company Inc.', 'ASE', 'Financial Services', 'Capital Markets', 'Cohen & Company Inc. is a financial services company specializing in a range of capital markets and asset management services. The Companys segments include Capital Markets, Asset Management, and Principal Investing. The Capital Markets business segment consists of fixed income sales, trading, and gestation repo financing, new issue placements in corporate and securitized products, underwriting, and advisory services, operating primarily through its subsidiaries, Cohen & Company Securities, LLC in the United States and Cohen & Company Financial (Europe) S.A. in Europe. The Asset Management segment manages assets through collateralized debt obligations, managed accounts, joint ventures, and investment funds. The Principal Investing segment comprises investments the Company holds related to its special purpose acquisition company (SPAC) franchise and other investments the Company has made for the purpose of earning an investment return.', 'Philadelphia, PA, United States', 118);\nINSERT INTO assets_master (ticker, asset_type, name, exchange, sector, industry, business_description, headquarters, employees_count) VALUES ('AOMR', 'STOCK', 'Angel Oak Mortgage REIT, Inc.', 'NYQ', 'Real Estate', 'REIT - Mortgage', 'Angel Oak Mortgage REIT, Inc. is a real estate investment trust (REIT) focused on acquiring and investing in first lien non-qualified residential mortgage (non-QM) loans and other mortgage-related assets in the United States mortgage market. Its objective is to generate attractive risk-adjusted returns for its stockholders through cash distributions and capital appreciation across interest rate and credit cycles. Its strategy is to make credit-sensitive investments in newly originated first lien non-QM loans that are primarily made to non-QM loan borrowers and primarily sourced from its mortgage lending platform, Angel Oak Mortgage Lending, which operates through a wholesale channel and has a national origination. It may also invest in other residential mortgage loans, residential mortgage-backed securities (RMBS), and other mortgage-related assets, which, collectively with non-QM loans, are referred to as target assets. It is managed and advised by Falcons I, LLC (the Manager).', 'Atlanta, GA, United States', NULL);\nINSERT INTO assets_master (ticker, asset_type, name, exchange, sector, industry, business_description, headquarters, employees_count) VALUES ('BIPI', 'STOCK', 'BIP Bermuda Holdings I Limited ', 'NYQ', NULL, NULL, NULL, '', NULL);\nINSERT INTO assets_master (ticker, asset_type, name, exchange, sector, industry, business_description, headquarters, employees_count) VALUES ('JFB', 'STOCK', 'JFB Construction Holdings', 'NCM', 'Real Estate', 'Real Estate - Development', 'JFB Construction Holdings is a commercial and residential real estate construction and development company. It provides services to commercial and residential markets, such as retail corporate buildouts, multifamily community developments and luxury residential homes. Its segments include Commercial Construction, Residential Construction and Real Estate Development. Its Commercial Construction segment includes all activities related to the construction of commercial properties such as office buildings, retail spaces, and industrial facilities. Its Residential Construction segment is focused on the construction of residential properties, including single-family homes and multifamily units. Within this segment, it provides custom-designed homes and remodels. Its Real Estate Development segment includes the acquisition, development, and sale of real estate properties. Its Real Estate Development segment is concentrated in South Florida, and in other Southern and United States markets.', 'Lantana, FL, United States', NULL);\nINSERT INTO assets_master (ticker, asset_type, name, exchange, sector, industry, business_description, headquarters, employees_count) VALUES ('CCM', 'STOCK', 'Concord Medical Services Holdings Limited', 'NYQ', 'Healthcare', 'Medical Care Facilities', 'Concord Medical Services Holdings Ltd is an investment holding company primarily engaged in the provision of comprehensive solutions for cancer medical treatment. The Company operates its business through two segments. The Network segment is engaged in providing enterprise customers with integrated oncology-related solutions, including primarily the supply, management and technical support for medical equipment and software solutions, and providing equipment leasing and comprehensive support services. The Hospital segment is engaged in providing a full spectrum of oncology healthcare services to cancer patients across the entire care continuum through its self-owned cancer hospitals and clinics. The Company mainly conducts its business in the domestic market.', 'Beijing, , China', 595);\nINSERT INTO assets_master (ticker, asset_type, name, exchange, sector, industry, business_description, headquarters, employees_count) VALUES ('BLCN', 'STOCK', 'Siren Nasdaq NexGen Economy ETF', 'NGM', NULL, NULL, 'Under normal circumstances, at least 80% of the fund''s assets, will be invested in component securities of the index. The index is designed to measure the returns of companies that are committing material resources to developing, researching, supporting, innovating or utilizing blockchain technology for their proprietary use or for use by others ("Blockchain Companies").', '', NULL);\nINSERT INTO assets_master (ticker, asset_type, name, exchange, sector, industry, business_description, headquarters, employees_count) VALUES ('SEG', 'STOCK', 'Seaport Entertainment Group Inc.', 'NYQ', 'Real Estate', 'Real Estate Services', 'Seaport Entertainment Group Inc. is an entertainment and hospitality company. The Companys segments include Landlord Operations, Hospitality, and Sponsorships, Events, and Entertainment. Its Landlord Operations segment is engaged in the operation of physical real estate assets located in the Seaport, a historic neighborhood in Lower Manhattan on the banks of the East River and within walking distance of the Brooklyn Bridge. Its Hospitality segment includes ownership interests in various food and beverage operating businesses. Its Sponsorships, Events, and Entertainment segment includes the Las Vegas Aviators Triple-A Minor League Baseball team and the Las Vegas Ballpark. Its portfolio encompasses a range of leisure and recreational activities, including live concerts, fine dining, professional sports, and high-end and experiential retail. The Companys portfolio includes The Seaport, New York, Las Vegas Aviators, Las Vegas Ballpark, Jean-Georges Management, and Fashion Show Mall.', 'New York, NY, United States', 180);\nINSERT INTO assets_master (ticker, asset_type, name, exchange, sector, industry, business_description, headquarters, employees_count) VALUES ('BSET', 'STOCK', 'Bassett Furniture Industries, Incorporated', 'NMS', 'Consumer Cyclical', 'Furnishings, Fixtures & Appliances', 'Bassett Furniture Industries, Incorporated is a retailer, manufacturer and marketer of branded home furnishings. Its products are sold through a network of Company-owned and licensee-owned branded stores under the Bassett Home Furnishings (BHF) name. Its segments include Wholesale and Retail-Company-owned stores. The Wholesale segment is involved in the design, manufacturing and sourcing of furniture products that are distributed through its BHF store network (both Company-owned and licensee-owned stores) and various independent retailers. The Retail-Company-owned stores segment consists of 58 BHF stores that provide consumers with a friendly and casual environment for buying furniture and accessories. The BHF stores feature custom order furniture, free in-home or virtual design visits (home makeovers) and coordinated decorating accessories. It also has a traditional wholesale business with more than 700 accounts on the open market, across the United States and internationally.', 'Bassett, VA, United States', 1228);\nINSERT INTO assets_master (ticker, asset_type, name, exchange, sector, industry, business_description, headquarters, employees_count) VALUES ('ATLN', 'STOCK', 'Atlantic International Corp.', 'NGM', 'Industrials', 'Staffing & Employment Services', 'Atlantic International Corp. is an outsourced services and workforce solutions company. The Company is engaged in servicing the commercial, professional, finance, direct placement, and managed service provider verticals. Through its principal operating subsidiary, Lyneer Investments LLC (Lyneer), it provides customers with complete HR solutions, operating 40 independent on-site and vendor-on-premises facilities. Its core offerings include staffing and recruitment, program management, data mastery, and continuous refinement. Staffing and recruitment offer pioneering client-centric forecasting and staffing solutions. Program management is a bespoke program ensuring longevity and growth in client partnerships. Data mastery is a database solution to monitor usage and pivotal data points. The Company provides permanent, temporary and temp-to-perm placement services in a wide variety of areas, including accounting and finance, administrative and clerical, hospitality, legal, among others.', 'Englewood Cliffs, NJ, United States', 300);\nINSERT INTO assets_master (ticker, asset_type, name, exchange, sector, industry, business_description, headquarters, employees_count) VALUES ('ACON', 'STOCK', 'Aclarion, Inc.', 'NCM', 'Healthcare', 'Health Information Services', 'Aclarion, Inc. is a healthcare technology company. The Company leverages magnetic resonance spectroscopy (MRS) and proprietary biomarkers to optimize clinical treatments. The Company has developed a software application called NOCISCAN. The product uses the existing MRS capabilities of many commercially available scanners to non-invasively analyze the chemical makeup of intervertebral discs in the spine. The software post-processes the MRS exam data and detects the presence of chemical biomarkers that Aclarion, in conjunction with spine researchers at University of California San Francisco (UCSF), have demonstrated to be associated with degenerative pain and structural integrity of the lumbar discs. After processing the MRS exam data, the Company sends the ordering clinician a report that details how to interpret the results of the MRS exam. The platform used to conduct a NOCISCAN involves a diagnostic report called a Nocigram that identifies discs as painful or not.', 'Broomfield, CO, United States', 5);\n